css:
kite-login {
  font-size: 1.2em;
  padding: 2.5em 2em 2em;
  margin: auto;
  display: block;
}
kite-login:not(.account-creation) .for-signup {
  display: none !important;
}
kite-login.account-creation .for-login {
  display: none !important;
}
kite-login svg {
  width: auto;
  height: 45px;
  position: absolute;
  right: 2em;
  top: 0.5em;
}
kite-login svg polygon {
  fill: #6494ed;
}
kite-login a {
  cursor: pointer;
}
kite-login .pull-right {
  margin-left: 10px;
}
kite-login:not(.password-less) .no-password {
  display: none;
}
kite-login.password-less .has-password {
  display: none;
}
kite-login .form-choice,
kite-login .form-status {
  margin: 10px 0;
}
kite-login .form-status {
  text-align: center;
}
kite-login .form-status.hidden {
  display: none;
}
kite-login .form-status:empty {
  display: none;
}
kite-login .form-choice {
  margin: 10px 0;
}
kite-login .form-choice .badge.badge-medium {
  vertical-align: baseline;
  padding: 8px 10px;
}
kite-login .form-choice .badge.badge-medium:not(.selected) {
  background: transparent;
  cursor: pointer;
}
kite-login .form-choice a:last-child {
  margin-left: 10px;
}
